Cala Goloritze opens up along the Costa di Baunei, between cliffs overlooking the sea and wild nature, a nesting environment for the Queen's falcon. A small paradise for sea lovers and freeclimbers. It can be reached on foot with a trek of about 3 km and 470mt in altitude, or by sea with a taxi boat service from Arbatax
.
Lungo la Costa di Baunei, tra pareti a strampiombo sul mare e natura selvaggia, ambiente di nidificazione del falco della Regina, si apre Cala Goloritze. Un piccolo paradiso per gli amanti del mare e freeclimbers. Si raggiunge a piedi con un trekking di circa 3 km e 470mt di dislivello, oppure via mare con servizio di barca taxi da Arbatax 
